  [],\n\t\"revision_timestamp\": \"2016-07-27T23:04:58.177839\",\n\t\"name\": \"decision-support-population-modeling-for-piping-plover-recovery\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Nest exclosures are a common management
  tool used to increase nest success of the threatened U.S. Atlantic Coast Piping
  Plover (Charadrius melodus) population. However, evidence suggests that exclosures
  can increase nest abandonment rates, and at least some of this abandonment may be
  caused by adult mortality associated with exclosure use. Previous demographic analyses
  indicated that Piping Plover population growth rate is most sensitive to adult survival
  rate, therefore the use of nest exclosures has the potential to negatively affect
  population growth rate even while increasing nest success. Furthermore, an analysis
  using a prototype management model suggested the effects of exclosure use on population
  growth rate were year- and site-dependent. The objective of the current project
  is to evaluate the effects of management and ecological covariates on Piping Plover
  nest survival and abandonment associated with exclosure use. The results of the
  nest survival model will be incorporated into a refined population projection model
  and used to develop a decision support tool that can predict site-specific effects
  of management actions including exclosure use on population growth rate. As part
  of this effort, we are inviting Piping Plover biologists throughout the U.S. and
  Canadian Atlantic Coast to collect and contribute data using a standardized protocol
  to be used in an exposure-based nest survival analysis that incorporates a range
  of ecological covariates.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
